import React from "react";
import "./ContactPage.css";

class ContactPage extends React.Component {
  render() {
    return (
      <div className="center">
        <h2>Contact us at:</h2>
        <p>seansoohyunkwon@gmail.com</p>
      </div>
    );
  }
}

export default ContactPage;
